import React, { useState } from "react";
import { useAuth0 } from "@auth0/auth0-react";

const Login = () => {

  const { loginWithRedirect } = useAuth0();

  
  return (
    <div>
        <button type="submit" onClick={() => loginWithRedirect()}>Login</button>
    </div>
  );
};

export default Login;
